    [],nt"num_tags": 0,nt"name": "al0-dens-a-map-that-shows-a-five-minute-grid-of-density-of-marine-birds-birds-sq-km-o-1980-200154b75",nt"isopen":
    false,nt"url": null,nt"notes": "AL0_DENS is a polygon shapefile representing
    5'x5' latitude x longitude cells that contain the overall, combined densities (birds/sq.km.),
    of 76 species of marine birds in the CDAS central CA data set, regardless of season
    and/or oceanic conditions. The number of marine birds seen in a cell was divided
    by the area sampled in the cell to estimate density. If a cell was censused more
    than once, densities were averaged. Cells that were surveyed but in which no birds
    were observed have densities of zero.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
